import React, { useState, useEffect } from 'react';
import axios from 'axios';
import "./body.scss";

function Body() {
    const [movie, setMovie] = useState({ hits: [] });
    useEffect(() => {
        const fetchData = async () => {
            const result = await axios.get(
                'https://api.themoviedb.org/3/search/movie?" +\n' +
                '        "query=potter&api_key=4d2868699f6ab95203d92eab296afa21&language=" +\n' +
                '        "en-US&page=1&include_adult=false',
            );
            setMovie(result.movie);
        };
        fetchData();
    }, []);
    return (
        <div>
            <h1>hallo</h1>
        <ul>
            {movie.hits.map(item => (
                <li key={item.objectID}>
                    <a href={item.url}>{item.title}</a>
                </li>
            ))}
        </ul>
        </div>
    );
}
export default Body;

